              <ListItemIcon>
                <Checkbox
                  edge="start"
                  checked={checked.indexOf(value) !== -1}
                  tabIndex={-1}
                  disableRipple
                  inputProps={{ 'aria-labelledby': labelId }}
                  color="default"
                />
              </ListItemIcon>
              <ListItemText id={labelId} secondary={`${value}`} />
            </ListItem>
          );
        })}
      </List> */}
    </React.Fragment>
  );
};

export default Categories;
